css:
/*dict.leo.org - black -- 2010-10-20*/
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain(dict.leo.org) {
/*removing ads and some empty table*/
#main > .sidebar,
.standard_banner,
#subnavigation + table
{
display: none !important;
}
/*limiting width, so the horizontal scrollbar does not show up unnecessarily*/
body
{
width: 99% !important;
}
*
{
border-collapse: collapse !important;
}
.tabContentContainer .content
{
width: auto !important;
}
.selector
{
height: auto !important;
}
/*general coloring*/
html,
table,
.assistance,
.middleform,
ul.optionContainer,
.pluginwrapper,
div.options div.panel
{
background: black !important;
color: white !important;
}
.warning
{
background: #400000 !important;
color: white !important;
}
.assistance ul.tab,
ul.option li,
li.plugin
{
border-bottom-color: #343434 !important;
}
/*link color*/
a:link,
.tab span,
ul.option,
#results span.link
{
color:#ff8000 !important;
}
/*visited link color*/
a,
a:visited
{
color:lightblue !important;
}
/*some forum coloring*/
.gecko
{
display: none !important;
}
.tab li
{
padding-bottom: 0 !important;
}
.thread .even,
.even,
.assistance .tab li span,
.notice,
div.container h1,
#body,
div.options
{
background: transparent !important;
}
ul.tab img,
#contentholder .content
{
margin-top: 0 !important;
}
.thread tr.author,
ul.action,
.navigation.active,
div.vcard,
.followup tr.author
{
color: white !important;
background:#121212 !important;
border-top: none !important;
}
.thread tr.author td,
.followup tr.author td
{
background: transparent !important;
}
.leftheading,
.assistance .tab li span.active,
.uneven,
div.options div.panel div.content h1
{
background:#232323 !important;
color: white !important;
}
.leftform
{
color: white !important;
}
.tab span.active,
.selector,
.pluginheader,
#multiword iframe
{
background:#232323 !important;
border: 1px #343434 solid !important;
}
/*some shading for odd rows/search row*/
tr.even,
#searchrow td.searchform,
table.maxwidth,
.popup h1,
.odd,
div.action > div,
.tabContentContainer h1,
li[style="background-color: rgb(228, 233, 255);"],
.tab span.inactive
{
background:#232323 !important;
color: white !important;
}
/*some shading for table headers*/
th
{
background:#121212 !important;
}
/*more popup color fixing*/
#divMoreInfo,
.popup,
.popup *
{
background-color: black !important;
}
.tab span:hover,
ul.option li:hover
{
text-decoration: none !important;
}
/*cleaning&coloring the borders a bit*/
#mainnavigation td,
#searchrow td.searchform,
table,
#searchrow td.searchform td tr.language,
table.border,
td.border,
tr.border,
#divMoreInfo td,
#divMoreInfo th,
.leftform,
div.action > div,
input[type="text"],
input[type="password"],
#overviewtopic .middleform,
.middleform,
.assistance,
.tab span,
fieldset,
.pluginwrapper,
div.form,
div.container h1,
#results td,
#results th,
div.options div.panel
{
border-collapse: collapse !important;
border: 1px #343434 solid !important;
}
/*removing highlight of selected language pair, the bold font should already be enough*/
#mainnavigation td.active,
.tab span.inactive
{
background: none !important;
}
/*replacing leo's image map*/
* > .spirit
{
background-image: url(data:image/png;base64,) !important;
}
}
